Skate Notes is the training notebook every skater and coach should have. You can use the application from two perspectives: Coach and Skater. As a coach you can:
 * Add your skaters to the connection list;
 * Create events, set the details and the location using Maps;
 * Invite connections to your events; * Create and update programs for your skaters;
 * Evaluate the performance of your skaters with the live-score function;
 * Observe the overall performance of your skaters;
 * See, in detail, the progress based on the base value of different elements from a program.
 As a skater you can:
 * Add coaches and skaters to your connection list;
 * Create and invite connections to events;
 * Create and update your own program;
 * Evaluate your performance with the live-score function;
 * Observe your overall performance;
 * See, in detail, the progress based on the base value of different elements from a program.
It does not matter if you are a coach, professional skater or just a casual skater, SkateNotes, is the app that will help you push your limits.

Please see  http://skatenotes.com/privacy-policy/ for our privacy policy and http://skatenotes.com/terms-and-conditions-skatenotes-app/ for our full terms of service.

A single platform to follow the Nerazzurri colours.
Exclusive news, photos, videos, Serie A, Champions League and the League Cup match commentaries: the new FCInterNews app, the leading newsfeed of the Nerazzurri, is the reference point to remain updated, live and in a complete customised way, on all the latest news from the Inter’s world.
The app now includes a notification system called 'Team +' which can be configured to give you advices when you are close to points of interest. These notifications contain small text reminders that warn you, for example, when you pass by an Inter store, a club, a gathering, etc.


▶ FEATURES OF THE APP

Downloading the app, you can:

- remain updated on the latest Nerazzurri’s news;
- check all the stats and the Inter’s standing in the different competitions;
- view fixtures and results;
- browse the photo and video gallery;
- listen to the podcasts from the Radio Nerazzurra;
- customise your Nerazzurri’s experience, thanks to the dedicated section “INTERests”.

